    left: 46,
    top: 9,
  },
  sginup: {
    top: 675,
  },
  loginButton: {
    backgroundColor: Color.skyblue_100,
  },
  login2: {
    color: Color.white,
  },
  login1: {
    top: 604,
  },
  forgotPassword: {
